Janta Army is a people's movement to save the Indian economy from collapsing after the COVID19 outbreak. It comprises you and me , or people like us, who take a pledge to buy products made it India.
BENEFITS:
- Helps boost the manufacturing sector
- Creates more employment opportunities
- Money stays in our country 
Repost this if you want to help our economy and tag 3 friends to motivate them to join the movement. Use the hashtags #MainBhiFauji #JantaArmy #SaveIndianEconomy 
We Indian Nailartists have come together to make you Indians aware of this movement and advertise products or brands that are "Made in India". Let's join hands together to save our economy.
